import React from 'react'

class OneProject extends React.Component{
    constructor(props){
        super(props);
        this.onClickClose=this.onClickClose.bind(this);
    }
    onClickClose(){

        this.props.removeProject(this.props.index);
    }
    render(){
        return (
        <li>
            <div>Name: {this.props.project.name}</div>
            <div>Description: {this.props.project.description}</div>
            <button onClick={this.onClickClose}>Delete</button>
        </li>
        )
    }
}

export default OneProject
